import { useState } from 'react';
import './App.css';

function App() {
  const [users, setUsers] = useState([]);

  const onUserAdd = (newUser) => {
    setUsers((prevUsers) => [...prevUsers, newUser]);
  };

  return <div className='App'></div>;
}

export default App;
